import React from 'react'
import styled from 'styled-components'

const ButtonAccount = styled.button`
  padding:10px 16px;
  margin:10px 0;
  border:none;
  background-color:#6768ab;
  color:white;


`

const Button = (props) => {
  return (
    <div>
    
  <ButtonAccount>{props.name}</ButtonAccount>
    </div>
  )
}

export default Button
